             <td><button onClick={props.handleDeleteSR} value={each.id}>Delete</button></td> 
          </tr>
    )})
    return(
        <div>
            <table>
                <tr>
                    <th>id</th>
                    <th>name</th>
                    <th>task</th>
                    <th>ctr</th>
